import React, {useState} from 'react';
import utils from "../../../utils/utils";
import AboutTab from "./tabs/AboutTab";
import JobTab from "./tabs/JobTab";
import PeopleTab from "./tabs/PeopleTab";

function TabView({name, company}) {
  switch (name) {
    case 'about':
      return <AboutTab company={company}/>
    case 'jobs':
      return <JobTab/>
    case 'people':
      return <PeopleTab/>
  }
}


function CompanyDetail(props) {
  const company = {
    name: 'Manhnd Co.Ltd',
    size: "10 to 100 employees",
    industry: 'Information technology',
    province: 'Hanoi',
    logo: 'https://upload.wikimedia.org/wikipedia/en/thumb/d/d3/Starbucks_Corporation_Logo_2011.svg/1200px-Starbucks_Corporation_Logo_2011.svg.png',
    address: 'Thanh Xuan, Ha Noi, Viet Nam',
    introduction: "This is a first company in Vietnam",
    photos: [
      "https://upload.wikimedia.org/wikipedia/commons/thumb/3/3a/M%C3%BCnster%2C_LVM%2C_B%C3%BCrogeb%C3%A4ude_--_2013_--_5149-51.jpg/1200px-M%C3%BCnster%2C_LVM%2C_B%C3%BCrogeb%C3%A4ude_--_2013_--_5149-51.jpg",
      "https://www.wework.com/ideas/wp-content/uploads/sites/4/2017/06/Web_150DPI-20190927_10th_Floor_Conference_Room_2_v1-1120x630.jpg",
      "https://www.jobstreet.com.ph/career-resources/wp-content/uploads/sites/3/2014/07/Is-the-Company-Youre-Working-for-Stable.jpg",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
    ]
  }
  const tabs = ['about', 'jobs', 'people'];
  const [currentTab, setCurrentTab] = useState(utils.getUrlParams('tab') || 'about')

  const changeTab = (tabName) => () => {
    utils.setUrlParams('tab', tabName);
    setCurrentTab(tabName)
  }

  return (
    <div>
      <div>Company detail</div>

        <figure className="image is-96x96">
          <img src={company.logo}/>
        </figure>

        <div className='title'>{company.name}</div>
      <div className='tabs is-boxed'>
        <ul>
          {tabs.map((tab, index) => (
            <li key={index}
                className={`${tab === currentTab ? `is-active` : ''}`}
                onClick={changeTab(tab)}
            >
              <a>
                <span>{tab[0].toUpperCase()+tab.slice(1)}</span>
              </a>
            </li>
          ))}

        </ul>
      </div>
        <TabView name={currentTab} company={company}/>

    </div>
  );
}

export default CompanyDetail;